<!DOCTYPE html>
<html lang="ko" xmlns:th="http://www.thymeleaf.org">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
</head>
<body>
    <div class="wrap">
        <table border="1">
            <tr th:each="date : ${excelDate}">
                <td>[[${date.in_num}]]</td>
                <td>[[${date.name}]]</td>
                <td>[[${date.RRN}]]</td>
                <td>[[${date.number}]]</td>
                <td>[[${date.address}]]</td>
            </tr>
        </table>
    </div>
</body>
</html>
